INSERT INTO `projet` VALUES (1,'2021-05-31','2021-03-15 15:02:33.977000','Notre association Doux repos permet aux maisons de retraite ayant un partenariat avec nous, d\'amener notre humanisme envers les personnes √¢g√©es.\r\nNous sommes une petite association de jeunes situ√©e au nord-est de Paris et nous manquons cruellement d\'infrastructure m√©dicale  pour prendre correctement en charge tous nos partenaires.','Nous sommes √† la recherche de mat√©riel m√©dical pour les maisons de retraite ORPEA tel que des lits m√©dicalis√©s, de fauteuils roulants, ou tout autre mat√©riel susceptible de rendre plus agr√©able le s√©jour des personnes vieillissantes.\r\n\r\nNous acceptons aussi bien √©videmment vos dons mon√©taires ou alors un peu de votre temps si vous voulez nous aider √† donner un coup de jeune √† ces endroits ainsi que pour l\'installation du mat√©riel. \r\n\r\nEncore merci pour ces personnes et de votre participation.\r\n',_binary '',_binary '',9000,0,'PUBLIE','Mat√©riel m√©dical pour les maisons de retraite',2,1),(2,'2021-04-30','2021-03-15 14:58:30.354000','L\'association Eclipse vient en aide aux H√¥pitaux de France demandant un appuie mat√©riel cons√©quent. Nous sommes une √©quipe de b√©n√©vole jeune et dynamique dans cette p√©riode difficile. Toute aide sera pr√©cieuse pour les malades et les praticiens.','Les h√¥pitaux de France sont dans un besoin constant de mat√©riel m√©dical ainsi que de besoin humain pour faire face √† cette p√©riode de crise telle que la COVID 19. Nous mettons en ≈ìuvre le transport des marchandises pour les aid√©s au quotidien. \r\n\r\nNous avons besoin de votre aide financi√®rement ou mat√©riellement pour leur donner le maximum de masque chirurgical ainsi que tout mat√©riel possible pour favoriser la gu√©rison des malades de la COVID 19 et surtout leur apr√®s...\r\n\r\nSi vous √™tes kin√©, les h√¥pitaux de France ont besoin d\'un maximum de vos talents pour r√©adapter les malades au niveau respiration apr√®s avoir surv√©cu √† la COVID-19.',_binary '',_binary '',15000,0,'PUBLIE','Les masques de nos vies',2,2),(3,'2021-06-30','2021-03-15 12:46:48.251000','Notre association est n√© il y a 10ans pour permettre de donner l\'autonomie aux personnes ayant des handicaps moteurs psychique,...','C\'est pour cela que nous souhaitons acheter des v√©los adapt√©s, √† assistance √©lectrique, pour permettre √† des personnes en situation de handicap de faire du v√©lo afin d\'aller se promener au-del√† de notre territoire.\r\n\r\nIl m\'est arriv√© assez souvent d\'aller faire de belles balades avec des cyclistes de notre foyer.\r\nMalheureusement, beaucoup de personnes ne peuvent pas b√©n√©ficier de ces sorties cyclistes. Nous avons bien un tandem pour emmener nos r√©sidents qui ont une relative autonomie, mais jamais nous ne pouvons-nous permettre d\'emmener ces personnes pour des balades d\'une heure ou plus. Et pourtant il y a beaucoup de demandes et de besoins auxquels ces sorties r√©pondent.\r\nVoil√† d√©j√† pr√®s de 2 ans maintenant, que le projet V√©lo pour Tous a m√ªri et que je r√©fl√©chis √† des solutions qui nous permettraient d\'emmener en sortie v√©lo toutes ces personnes EXTRAordinaires (en fauteuil ou pas).\r\n',_binary '',_binary '\0',40000,0,'PUBLIE','Un V√©lo pour TOUS',3,3),(4,'2021-07-31','2021-03-15 15:14:11.222000','Sand Lor organise cette cagnotte solidaire au nom de Laure Ren√©.','Un an s√©pare ces 2 photos\r\n\r\nUn an apr√®s la d√©couverte de ce cancer du sein hyper agressif, un an apr√®s toutes les √©tapes invasives et la fatigue, les moments d\'espoir et de d√©sespoir,  apr√®s 4 chimioth√©rapies diff√©rentes, radioth√©rapie, chirurgie, le cancer a continu√© √† progresser en envahissant poumon et ganglion. La seule option est l\'immunotherapie associ√©e √† la vaccinotherapie et la chimioth√©rapie.\r\nMalheureusement pour les deux premiers, seule une clinique en Allemagne peut les faire.\r\n\r\nTu gardes ton sens de l\'humour malgr√© ces coups de la vie qui petit √† petit te co√ªtent la tienne.\r\n\r\nCe traitement, c\'est ta derni√®re carte √† jouer, nous allons nous mobiliser pour raviver cette flamme que tu as en toi !\r\n',_binary '\0',_binary '\0',100000,0,'PUBLIE','Aidez Laure dans son combat contre le Cancer',4,4),(5,'2021-08-15','2021-03-15 15:18:36.867000','Dimitri Perrier et Nicolas Gautry organisent cette cagnotte solidaire pour Mikhael KROTOV.\r\n','Bonjour,\r\n\r\nJe m‚Äôappelle Mikhael Krotov. Je suis p√®re de famille, j‚Äôai 38 ans, et d‚Äôici quelques mois je n‚Äôaurai plus l‚Äôusage de mes poumons.\r\n\r\nJe souffre d‚Äôune maladie g√©n√©tique rare, la dysk√©ratose cong√©nitale, qui a tout fait basculer en tr√®s peu de temps. Heureusement j‚Äôai un espoir, qui r√©side √† Pittsburgh, aux Etats-Unis, o√π une √©quipe de m√©decins de l\'UPMC a mis au point un protocole qui pourrait me sauver. Pour moi, pour ma femme, pour nos 3 enfants, ce serait un miracle.\r\n\r\nAu-del√† de moi, ce serait aussi un pas de plus dans une tr√®s grande avanc√©e m√©dicale men√©e par les meilleurs sp√©cialistes, un miracle pour tous les malades n√©cessitant une combinaison de greffes complexes comme la mienne.\r\n\r\nCe miracle est tr√®s on√©reux (estim√© √† 1 million de dollars), il me faut de l‚Äôaide pour le financer. C\'est pourquoi mes proches lancent simultan√©ment des cagnottes √† travers le monde afin de faire face √† une partie de cette somme, ce qui permettra d\'enclencher le processus de soin, une premi√®re √©tape d√©cisive sans quoi rien n\'est possible.\r\n\r\nS\'il-vous-pla√Æt partagez mon histoire et donnez 10 euros, 20 euros, ou ce qui vous semble raisonnable. Je vous devrai la vie.\r\nPour suivre mon histoire ou pour acc√©der √† d\'autres moyens de paiement: Blog Sauver Mikhael Krotov.\r\n\r\n#SaveMikhaelKrotov\r\n',_binary '\0',_binary '\0',250000,0,'PUBLIE','Sauvons Mikhael greffe de poumons',4,5),(6,'2021-05-20','2021-03-15 14:11:41.046000','Funds go to Social & Economic Action for Lebanon, Inc.\r\n','Former NBA basketball player and music producer Rony Seikaly is quickly responding to the tragic explosion in Beirut and needs your support. He is personally donating $100,000 to relief efforts in Lebanon. But he urgently needs your help to reach more people in need.\r\n\r\nMore than 300,000 people are left homeless after a massive explosion devastated Beirut on August 4. At least 137 people have died, more than 5,000 are injured, and many are still missing. With the Beirut Port destroyed, the country is left with only a few days worth of food and medical supplies. \r\n\r\nRony partnered with SEAL, a 501(c)3 non-profit organization founded in New York City, to help with this immediate crisis. Launched in 1997 by a group of Lebanese-Americans, SEAL has since played a critical role in helping underserved communities in Lebanon.\r\n\r\nSEAL will direct the funds in full transparency to well-vetted NGOs based in Lebanon. Their focus is on: Shelter, Food, Medication/Medical Support, and Rehabilitation.\r\n\r\nTo date, the following NGOs have been selected: the Lebanese Red Cross, Beit El Baraka, Arcenciel, AlGhina, Lebanon Needs, Nusaned, and Offre Joie. Others are currently being vetted. \r\n\r\nJoin Rony in response to this devastating tragedy. Every donation, no matter how small, counts more than you know.\r\n\r\nAll donations are fully tax-deductible.\r\n',_binary '',_binary '\0',600000,0,'PUBLIE','Help Lebanon with Rony Seikaly',5,6),(7,'2021-07-22','2021-03-15 14:17:06.151000','L‚Äô√©cole, chacun y a droit ! Elle donne sa chance √† chaque enfant et lui laisse entrevoir la perspective d‚Äôune vie meilleure.\r\n','L‚Äô√©cole, chacun y a droit ! Elle donne sa chance √† chaque enfant et lui laisse entrevoir la perspective d‚Äôune vie meilleure.\r\nMais aujourd‚Äôhui d‚Äô√©cole il n‚Äôy a plus ! Le lac Baringo a vu ces derni√®res ann√©es son niveau monter, monter, jusqu‚Äô√† inonder une tr√®s grande partie du village de naissance de Simon. De nombreuses habitations, des h√¥tels, l‚Äôinfirmerie, des restaurants, des √©coles ont √©t√© noy√©s, des centaines d‚Äôemplois sont perdus, l\'√©conomie est exsangue.\r\nA l‚Äôinitiative de Simon Chebon et de Arnaud Marchais qui g√®re l‚Äôassociation Troisi√®me plan√®te, nous avons d√©cid√© que ce serait la moindre des choses que de redonner l‚Äôespoir √† 260 gamins, des coll√©giens de 12 √† 14 ans, priv√©s de leur √©cole.\r\nIl s‚Äôagira de grands b√¢timents, juste le gros ≈ìuvre, des murs, fen√™tres, toits et am√©nagement de la salle, qui pourront accueillir chacun 40 ou 50 √©l√®ves. Il faut compter un peu moins de 1 200 000 Shillings, soit approximativement 10000 ‚Ç¨ pour r√©aliser la construction d‚Äôune salle de classe.\r\nCe projet sera compl√©t√© par une formation sp√©cifique de l‚Äô√©ducation √† l‚Äôenvironnement anim√©e par Kangor Titus, Arnaud y reviendra en d√©tail, et, plus tard, je m‚Äôen occuperai personnellement, la possibilit√© pour les safaristes qui le veulent bien de parrainer un enfant, pour un an ou davantage, le temps de sa scolarit√© (cela ne co√ªte que quelques d√©risoires dizaines d‚ÄôEuros), les √©coles ne sont pas gratuites au Kenya.\r\nTony Crocetta.\r\n',_binary '',_binary '',10000,0,'PUBLIE','Une √©cole pour Baringo',6,7),(8,'2021-06-24','2021-03-15 14:19:59.905000','Covid-19 SOS Guin√©e est une initiative caritative ayant pour but d\'apporter un soutien √† la population vuln√©rable de Guin√©e, dans la lutte contre le CoronaVirus.\r\n','Covid-19 SOS Guin√©e est une initiative caritative ayant pour but d\'apporter un soutien √† la population vuln√©rable de Guin√©e, dans la lutte contre le CoronaVirus.\r\n\r\nLe plan de riposte √©conomique √† cette crise sanitaire, impose des restrictions qui vont √† l‚Äôencontre des int√©r√™ts des plus d√©favoris√©s. De ce fait, certaines familles ne parviennent pas √† subvenir √† leur besoin primaire et essentiel.\r\n\r\nC‚Äôest suite √† ce constat que l‚Äôinitiative Covid-19 SOS Guin√©e est n√©e. Elle pr√¥ne un appel √† la solidarit√© et vise √† collecter des fonds destin√©s √† accompagner ce segment de la population dans la situation actuelle de crise.\r\n\r\nLes fonds collect√©s seront essentiellement allou√©s √† l‚Äôachat de denr√©es alimentaires de premi√®res n√©cessit√©s.\r\n\r\nNous faisons donc appel √† la g√©n√©rosit√© de chacun pour soutenir cette cause et invitons toute bonne volont√© √† apporter une aide √† la pr√©sente initiative.\r\n',_binary '',_binary '\0',10000,0,'PUBLIE','Covid-19 SOS Guin√©e',7,8),(9,'2021-07-13','2021-03-15 14:29:18.876000','L\'association Aide son prochaine est d\'utilit√© public.... sous la loi 1901.... ','La famine dans le monde est trop √©lev√© de nos jours et nous voulons l\'√©radiquer.',_binary '',_binary '\0',345000,0,'REJETE','Aider la famine dans le monde',8,9);
